import React from "react";

function Footer() {
  return (
    <div>
      <h1>This is footer</h1>
      <footer class="Site-footer">
      	<div class="Footer"><span class="Footer-social">
      		<iframe class="github-btn" src="https://ghbtns.com/github-btn.html?user=philipwalton&amp;repo=solved-by-flexbox&amp;type=watch&amp;count=true" allowtransparency="true" frameborder="0" scrolling="0" width="109px" height="20px">
      		</iframe>
      		<iframe id="twitter-widget-0" scrolling="no" frameborder="0" allowtransparency="true" allowfullscreen="true" class="twitter-follow-button twitter-follow-button-rendered" style="position: static; visibility: visible; width: 222px; height: 20px;" title="Twitter Follow Button" src="https://platform.twitter.com/widgets/follow_button.6a44a9d26983bbb5b04ae399f9e496fe.en.html#dnt=false&amp;id=twitter-widget-0&amp;lang=en&amp;screen_name=philwalton&amp;show_count=true&amp;show_screen_name=true&amp;size=m&amp;time=1575326717385" data-screen-name="philwalton">
      		</iframe> <iframe id="twitter-widget-1" scrolling="no" frameborder="0" allowtransparency="true" allowfullscreen="true" class="twitter-share-button twitter-share-button-rendered twitter-tweet-button" style="position: static; visibility: visible; width: 61px; height: 20px;" title="Twitter Tweet Button" src="https://platform.twitter.com/widgets/tweet_button.6a44a9d26983bbb5b04ae399f9e496fe.en.html#dnt=false&amp;id=twitter-widget-1&amp;lang=en&amp;original_referer=https%3A%2F%2Fphilipwalton.github.io%2Fsolved-by-flexbox%2Fdemos%2Fsticky-footer%2F&amp;related=philwalton%3ACreator%20of%20Solved%20by%20Flexbox&amp;size=m&amp;text=A%20showcase%20of%20traditionally%20hard%20CSS%20problems%2C%20easily%20solved%20using%20flexbox.&amp;time=1575326717386&amp;type=share&amp;url=https%3A%2F%2Fphilipwalton.github.io%2Fsolved-by-flexbox%2F&amp;via=philwalton" data-url="https://philipwalton.github.io/solved-by-flexbox/"></iframe>
      		</span><div class="Footer-credits">
      		<span class="Footer-credit">Created and maintained by <a href="https://philipwalton.com">Philip Walton</a>.</span> 
      		<span class="Footer-credit">Source code and examples released under the <a href="https://github.com/philipwalton/solved-by-flexbox/blob/master/LICENSE">MIT</a> license.</span> 
      		<span class="Footer-credit">Website and documentation licensed under <a href="https://creativecommons.org/licenses/by/4.0/">CC BY 4.0</a>.</span>
      		</div></div>
      	</footer>
    </div>
  );
}

export default Footer;
